from typing import List


class Solution:
    def maxTrailingZeros(self, grid: List[List[int]]) -> int:
        """Count 2 and 5, use imaginary number to simplify the process"""
        M, N = len(grid), len(grid[0])
        for i in range(M):
            for j in range(N):
                num_2 = 0
                while grid[i][j] % 2 == 0:
                    grid[i][j] //= 2
                    num_2 += 1
                num_5 = 0
                while grid[i][j] % 5 == 0:
                    grid[i][j] //= 5
                    num_5 += 1
                grid[i][j] = num_2 + num_5 * (1j)
        cpv = [[0] * N for _ in range(M)]
        for j in range(N):
            for i in range(M):
                if i == 0:
                    cpv[i][j] = grid[i][j]
                else:
                    cpv[i][j] = grid[i][j] + cpv[i - 1][j]
        cph = grid
        for i in range(M):
            for j in range(1, N):
                cph[i][j] += cph[i][j - 1]
        res = 0
        for i in range(M):
            for j in range(N):
                p1 = cph[i][j] + (cpv[i - 1][j] if i > 0 else 0)
                p2 = cph[i][j] + (cpv[M - 1][j] - cpv[i][j])
                p3 = (cph[i][N - 1] - (cph[i][j - 1] if j > 0 else 0)) + (cpv[M - 1][j] - cpv[i][j])
                p4 = (cph[i][N - 1] - (cph[i][j - 1] if j > 0 else 0)) + (cpv[i - 1][j] if i > 0 else 0)
                res = max(
                    res,
                    int(min(p1.imag, p1.real)),
                    int(min(p2.imag, p2.real)),
                    int(min(p3.imag, p3.real)),
                    int(min(p4.imag, p4.real)),
                )
        return res

        

